import { Button, Col } from 'react-bootstrap';
import '../App.css';
export default function Welcome() {
  return (
   <Col lg="4" className='bg-primary mt-2 mb-4 p-2 '>
       <div className=' rounded position-relative justify-content-center d-flex'> 

        <h3 className='mt-2 ms-2'>Bienvenido Gabriel</h3><Button  variant='danger' className='rounded-pill '>Out</Button>

        </div>
   </Col>
  )
}
